import {Label, Input} from './Filter.styled';
import PropTypes from 'prop-types';

const Filter = ({value, onChange}) => (
    <Label>
        Filter by name:     
        <Input 
            name="filter"
            value={value}
            onChange={onChange}
        />
    </Label>
);

Filter.propTypes = {
    onChange: PropTypes.func.isRequired,
}

export default Filter;
